import Link from 'next/link'
import { motion } from "framer-motion"

export default function NavLink (props) {
	return (
		<li>
			<Link href={props.href}>
				<motion.a
					whileHover={{ scale: 1.2 }}
				>
					{props.children}
				</motion.a>
			</Link>
		</li>
	)
}
